import React, { Component } from 'react'
import './styles.css'

export default class About extends Component {
    render() {
        return (
            <article className="Main-container">
                <h1>Seccion Acerca</h1>
                <p> Informacion del comercio, utilidades, nuevos proyectos etc. </p>
            </article>
        )
    }
}
